// SPDX-License-Identifier: MIT
/** @title Aggregator */
/** @author Zergity */

pragma solidity >=0.6.2;
pragma experimental ABIEncoderV2;

import '@uniswap/lib/contracts/libraries/TransferHelper.sol';
import "./interfaces/IERC20.sol";
import "./interfaces/IWETH.sol";
import './interfaces/IUniswapV2Router02.sol';
import './interfaces/IUniswapV2Factory.sol';
import './interfaces/IUniswapV2Pair.sol';
import './interfaces/IAggregator.sol';

contract Aggregator2 is IAggregator {
    address private constant COIN = 0xEeeeeEeeeEeEeeEeEeEeeEEEeeeeEeeeeeeeEEeE;
    address private constant WCOIN = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;

    // accepting COIN
    receive() external payable {}

    function aggregate(
        Order   calldata    order,
        Route[] calldata    routes,
        address payable     recipient,
        address             referrer
    ) external payable returns (uint amountOut, uint gasLeft) {
    unchecked {
        // not correct if tokenIn == tokenOut
        amountOut = _balance(order.tokenOut, recipient);

        if (order.tokenIn == COIN) {
            require(order.amountIn == msg.value, "Aggregator: amountIn != msg.value");
            IWETH(WCOIN).deposit{value: msg.value}();
        }

        uint spentAmount;

        for (uint i; i < routes.length; ++i) {
            if (order.tokenIn == COIN) {
                TransferHelper.safeTransfer(WCOIN, routes[i].steps[0][2], routes[i].amount);
            } else {
                // direct transfer tokenIn from msg.sender
                TransferHelper.safeTransferFrom(order.tokenIn, msg.sender, routes[i].steps[0][2], routes[i].amount);
            }

            for (uint j; j < routes[i].steps.length; ++j) {
                _swapSupportingFeeOnTransferTokens(routes[i].steps[j]);
            }

            spentAmount += routes[i].amount;
        }

        require(spentAmount == order.amountIn, "Aggregator: spentAmount != amountIn");

        if (order.tokenOut == COIN) {
            uint balance = IERC20(WCOIN).balanceOf(address(this));
            IWETH(WCOIN).withdraw(balance);
            TransferHelper.safeTransferETH(recipient, address(this).balance);
        }

        { // stack too deep
            uint balance = _balance(order.tokenOut, recipient);
            require(balance >= amountOut, 'Aggregator: NEGATIVE_OUTPUT_AMOUNT');
            amountOut = balance - amountOut;
            require(amountOut >= order.amountOutMin, 'Aggregator: INSUFFICIENT_OUTPUT_AMOUNT');
        }

        emit Swapped(
            msg.sender,
            order.tokenIn,
            order.tokenOut,
            recipient,
            order.amountIn,
            spentAmount,
            amountOut,
            order.amountOutMin,
            referrer
        );

        return (amountOut, gasleft());
    } }

    // **** SWAP (supporting fee-on-transfer tokens) ****
    // requires the initial amount to have already been sent to the first pair
    function _swapSupportingFeeOnTransferTokens(address[] memory path) internal {
        for (uint i = 1; i+3 < path.length; i += 2) {
            (address input, address output) = (path[i], path[i+2]);
            IUniswapV2Pair pair = IUniswapV2Pair(path[i+1]);
            uint amountOutput;
            { // scope to avoid stack too deep errors
                uint amountInput;
                {
                    (uint r0, uint r1,) = pair.getReserves();
                    uint ri = input < output ? r0 : r1;
                    amountInput = IERC20(input).balanceOf(address(pair)) - ri;
                }
                address[] memory tokens = new address[](2);
                tokens[0] = input;
                tokens[1] = output;
                amountOutput = IUniswapV2Router02(path[0]).getAmountsOut(amountInput, tokens)[1];
            }
            (uint amount0Out, uint amount1Out) = input < output ? (uint(0), amountOutput) : (amountOutput, uint(0));
            pair.swap(amount0Out, amount1Out, path[i+3], new bytes(0));
        }
    }

    function _balance(address token, address adr) internal view returns (uint) {
        return token == COIN ? adr.balance : IERC20(token).balanceOf(adr);
    }
}
